export function cardImage(numberCard) {
  const cardNumberValidation = valid.number(numberCard);

  if (cardNumberValidation.card !== null) {
    // console.log(cardNumberValidation.card.type);
    switch (cardNumberValidation.card.type) {
      case 'maestro':
        return logomMestro;
      case 'discover':
        return logoDiscover;
      case 'american-express':
        return logoAmericanExpress;
      case 'visa':
        return logoVisa;
      case 'mastercard':
        return logoMastercard;
      case 'mir':
        return logoMir;
      case 'unionpay':
        return logoUnionPay;
      case 'diners-club':
        return logoDinersClub;
      case 'jcb':
        return logoJCB;
    }
  } else return '';
}
